export const type = {
  STUDENT_DATA: 'STUDENT_DATA'
}

export function sendStudentData(studentID, studentPassword, studentMajor) {
  return{
    type: type.STUDENT_DATA,
    studentID,
    studentPassword,
    studentMajor,
  }
}
